package no.entur.abt.android.token.provider;

public class TokenProviderBuilderException extends RuntimeException {

	private static final long serialVersionUID = 1L;

	public TokenProviderBuilderException() {
		super();
	}

	public TokenProviderBuilderException(String message, Throwable cause) {
		super(message, cause);
	}

	public TokenProviderBuilderException(String message) {
		super(message);
	}

	public TokenProviderBuilderException(Throwable cause) {
		super(cause);
	}

}
